import React from 'react'
import { Header, Container } from 'semantic-ui-react'
import Head from 'next/head'

export default () => {
    return(
        <Container>
            <Header as='h3' dividing textAlign = "center" style = {{ marginTop : '10px'}}>
                Voting Starts Here
            </Header>
           
        </Container>
        
    )
}
